using DocumentFormat.OpenXml;
using DocumentFormat.OpenXml.Packaging;
using DocumentFormat.OpenXml.Wordprocessing;
using HtmlToOpenXml;
using System;

namespace DocumentFormatOpenXmlTestConsole
{
    class Program
    {
        static void Main(string[] args)
        {
            Console.WriteLine("Hello World!");

            ExportToWord();
        }

        public static void ExportToWord()
        {
            string htmlValue = "<b>dasdsadsa</b>" +
                "<br>" +
                $"<img style='display:block; width:100px;height:100px;' id='base64image' src='data:image/jpeg;base64, {TestImage()}' />";

            //see https://docs.microsoft.com/en-us/dotnet/api/documentformat.openxml.wordprocessing.document?redirectedfrom=MSDN&view=openxml-2.8.1

            string fileName = $"{AppDomain.CurrentDomain.BaseDirectory}result.docx";

            // Create a document.   
            using (WordprocessingDocument myDocument =
                WordprocessingDocument.Create(fileName, WordprocessingDocumentType.Document))
            {
                // Add a main part.   
                MainDocumentPart mainPart = myDocument.AddMainDocumentPart();
                HtmlConverter converter = new HtmlConverter(mainPart);
                var a = converter.Parse(htmlValue);

                // Create the document structure.  
                mainPart.Document = new Document();
                Body body = mainPart.Document.AppendChild(new Body());
                body.Append(a);
                //Paragraph para = body.AppendChild(new Paragraph());
                //Run run = para.AppendChild(new Run());

                //// Add some text to the document.  
                //run.AppendChild(new Text("Hello, World!"));
            }
            Console.WriteLine("The document has been created.\nPress a key.");
            Console.ReadKey();

        }

        public static string TestImage()
        {
            return "";
        }
    }
}
